import React from 'react';
import Navbar from '../../parcials/Navbar';
import {
    MDBCard,
    MDBCardBody
} from 'mdbreact';
import SectionContainer from '../../components/sectionContainer';

const TransferSystemPage = () => {
    return (
        <Navbar>
            <SectionContainer title='Content types' header='Body'>
                <MDBCard>
                    <MDBCardBody>This is some text within a panel body.</MDBCardBody>
                </MDBCard>
            </SectionContainer>
        </Navbar>
    )
}

export default TransferSystemPage;
